import React from 'react';

const ReportButton = () => {
  return (
    <button
      className="btn btn-lg"
      style={{
        backgroundColor: '#4caf50',
        color: '#fff',
        border: 'none',
        borderRadius: '5px',
        padding: '10px 20px',
        fontSize: '18px',
        marginTop: '20px',
      }}
    >
      REPORT NOW!
    </button>
  );
};

export default ReportButton;
